Here is a simplified version of the smart contract that fulfills the requirements you outlined:

```solidity
pragma solidity ^0.6.12;

contract Exchange {
    mapping(address => uint256) public admin;
    mapping(address => uint256) public addressOfBountyMembers;
    address public feeaccount;
    address public accountlevelsaddr;
    uint256 public feemake;
    uint256 public feetake;
    uint256 public feerebate;
    mapping(address => mapping(address => uint256)) public balanceOf;
    mapping(address => mapping(bytes32 => uint256)) public orders;
    mapping(address => mapping(bytes32 => uint256)) public orderFills;

    function withdraw(uint256 amount) public {
        require(amount <= admin[msg.sender], "Insufficient funds");
        admin[msg.sender] -= amount;
        msg.sender.transfer(amount);
    }

    function changeFeeMake(uint256 _feeMake) public {
        require(admin[msg.sender] != 0, "Only admin can change fee");
        feemake = _feeMake;
    }

    function changeFeeAccount(address _feeAccount) public {
        require(admin[msg.sender] != 0, "Only admin can change fee account");
        feeaccount = _feeAccount;
    }

    function changeFeeRebate(uint256 _feeRebate) public {
        require(admin[msg.sender] != 0, "Only admin can change fee rebate");
        feerebate = _feeRebate;
    }

    function depositToken(address token, uint256 amount) public payable {
        require(token != address(0), "Token address cannot be 0");
        balanceOf[msg.sender][token] += amount;
    }

    function order(address token, uint256 amount, address token2, uint256 amount2, uint256 nonce, uint256 expiry) public {
        bytes32 orderHash = sha256(abi.encodePacked(this, token, amount, token2, amount2, nonce, expiry));
        orders[msg.sender][orderHash] = 1;
    }

    function changeAdmin(address _admin) public {
        require(admin[msg.sender] != 0, "Only admin can change admin");
        admin[_admin] = 1;
    }

    function changeFeeTake(uint256 _feeTake) public {
        require(admin[msg.sender] != 0, "Only admin can change fee take");
        feetake = _feeTake;
    }

    function cancelOrder(address token, uint256 amount, address token2, uint256 amount2, uint256 nonce, uint256 expiry, uint8 v, bytes32 r, bytes32 s) public {
        bytes32 orderHash = sha256(abi.encodePacked(this, token, amount, token2, amount2, nonce, expiry));
        require(orders[msg.sender][orderHash] != 0, "Order does not exist");
        orderFills[msg.sender][orderHash] = amount;
    }

    function amountFilled(address token, uint256 amount, address token2, uint256 amount2, uint256 nonce, uint256 expiry, address user, uint8 v, bytes32 r, bytes32 s) public view returns (uint256) {
        bytes32 orderHash = sha256(abi.encodePacked(this, token, amount, token2, amount2, nonce, expiry));
        return orderFills[user][orderHash];
    }

    function changeAccountLevelsAddr(address _accountLevelsAddr) public {
        require(admin[msg.sender] != 0, "Only admin can change account levels address");
        accountlevelsaddr = _accountLevelsAddr;
    }

    function deposit() public payable {
        admin[msg.sender] += msg.value;
    }

    function withdrawToken(address token, uint256 amount) public {
        require(token != address(0), "Token address cannot be 0");
        require(balanceOf[msg.sender][token] >= amount, "Token balance is insufficient");
        balanceOf[msg.sender][token] -= amount;
    }
}
```

Please note that this is a simplified version and does not include all the necessary error checking and security measures that a real-world smart contract should have. For example, it does not check for overflows or underflows, and it does not check the validity of signatures in the `cancelOrder` and `amountFilled` functions.
